import icons from "../Assets/img/icons.svg";

const Pagination = () => {
  const curPage = 10;
  return (
    <div>
      <button>{curPage}</button>
      <button>20</button>
      <button>{curPage}</button>
    </div>
  );
};

export default Pagination;
